import http from "../http-upload-common";
class FileUploadService {

    create(url,data) {
      let formData = new FormData();  
      formData.append("MTUSER_ID",data.MTUSER_ID);
      formData.append("EMAIL",data.EMAIL); 
      formData.append("MODULE",data.MODULE);
      formData.append("TEAM_SNO"+data.TEAM_SNO);
      formData.append("TEAM_MEMBER_NAME"+data.TEAM_MEMBER_NAME);
      formData.append("TEAM_MEMBER_POSITION"+data.TEAM_MEMBER_POSITION);
      formData.append("TEAM_SNO"+data.FB_LINK);
      formData.append("TEAM_SNO"+data.INSTA_LINK);
      formData.append("TEAM_SNO"+data.LINKEDIN_LINK);
      formData.append("TEAM_SNO"+data.TEAM_BIO);
      formData.append("TEAM_SNO"+data.PROFILE_PIC);
      formData.append("TEAM_SNO"+data.STATUS);
      formData.append("TEAM_SNO"+data.COMMENTS);
      formData.append("TEAM_SNO"+data.DESCRIPTION);
      formData.append("TEAM_SNO"+data.CREATED_USER);
      formData.append("TEAM_SNO"+data.CREATED_DATE);
      formData.append("TEAM_SNO"+data.MODIFIED_USER);
      formData.append("TEAM_SNO"+data.MODIFIED_DATE);

        return http.post(url, formData);//localhost:8000/api/mt_user(data)
      }

  upload(file, onUploadProgress) {
    let formData = new FormData();
    formData.append("file", file);
    return http.post("/upload", formData, {
      headers: {
        "Content-Type": "multipart/form-data",
      },
      onUploadProgress,
    });
  }


  getFiles() {
    return http.get("/files");
  }



}
export default new FileUploadService();
